import React from 'react'
import { Jumbotron, Container } from 'reactstrap';

const Jumbo = (props) => {
	return (
		<div>
		<Jumbotron fluid>
			<Container>
				<h3>점보트론</h3>
			</Container>
		</Jumbotron>
		</div>
	);
};

export default Jumbotron;
